class Solution:
    def longestPalindrome(self, s: str) -> str:
        size = len(s)
        if size == 0:
            return ""
        if size == 1:
            return s
        substring = ""
        substring_count = {}
        max_count = 0
        for x in range(size):
            for char in s[x:]:
                substring += char
                substring_2 = substring[::-1]
                if substring == substring_2:
                    max_count = max(max_count, len(substring))
                    substring_count[len(substring)] = substring_2
            substring = ""
        return ''.join(substring_count[max_count])


solution = Solution()
